function ApiPost(e, Form, Response) {
		//console.log('ApiPost Start');
		var FormName = Form.context.name;
		e.preventDefault();
		if ( $(Form).valid() ) {
			//console.log(FormName+": Valid OK");
			//console.log('https://api8web.pxsol.com'+'/'+Form.attr("action"));
			BtnSubmit = Form.find("button[type='submit']");
			BtnSubmit.prop('disabled', true);
			FnLoadingON();
			$.ajax({
				async:true,
				url:'https://api8web.pxsol.com'+'/'+Form.attr("action"),
				data:Form.serialize(),
				type:"POST",
				dataType: 'json',
				success: function(data){
					//console.log("Ajax Complete");
					//console.log(data);

					if (data.ApiResponse == "ERROR") {
						//console.log('%c API Error on '+Form.attr("action")+' ', 'background: #FF0000; color: #FFFFFF');
						//console.log('%c Error: '+data.Message+' ', 'background: #FF0000; color: #FFFFFF');
						//console.log('%c File: '+data.File+' ', 'background: #FF4F4F; color: #FFFFFF');
						//console.log('%c Line: '+data.Line+' ', 'background: #FF6969; color: #FFFFFF');
						alert("API Error");
					} else {
						//console.log("Response");
						//console.log(data);
						Response(data);
					}
					BtnSubmit.prop('disabled', false);
					FnLoadingOFF();

				},
				error: function(data){
					//console.log('%c '+data.responseText+' ', 'background: #FF0000; color: #FFFFFF');
					alert('AJAX Error: '+data.responseText);
				},
				complete: function(data){
					Response(data);
					//console.log("Ajax Complete Api Dev");

				},
				send: function(data){
					//console.log("Ajax Send");
				},
				start: function(data){
					//console.log("Ajax Start");
				}
			})

		} else {
			//console.log(FormName+": No valid");
			//console.log(FormName+": "+Form.attr("action") );
			MostrarError('Algunos datos ingresados no son correctos');
			return 0;
		}
}

