function extractHostname(url) {
  var hostname = "NN";
  //find & remove protocol (http, ftp, etc.) and get hostname
  //console.log(url);
  if (!url || url === null) {
    return hostname;
  }
  if (typeof url !== "undefined" && url.length > 0) {
    if (url.indexOf("//") > -1) {
      hostname = url.split("/")[2];
    } else {
      hostname = url.split("/")[0];
    }

    //find & remove port number
    hostname = hostname.split(":")[0];
    //find & remove "?"
    hostname = hostname.split("?")[0];
  }
  return hostname;
}

/* Setear TAG, si existe, desde Querystring o Cookie, en ese orden */

var tagPxsolEngine = "";

function setTag() {
  var tag = findGetParameter("tag")
    ? findGetParameter("tag")
    : findGetParameter("Tag");
  var hostname = extractHostname(tag);
  tag = tag ? hostname : tag;
  //console.log("--TAG-- Tag parameter: " + tag);
  if (tag) {
    setCookie("tag", tag, 30);
  } else {
    tag = getCookie("tag");
    tag = extractHostname(tag);
  }


  /* Setear UTM_SOURCE, si existe, desde Querystring o Cookie, en ese orden */

  var utm_source = findGetParameter("utm_source");
  //console.log("--TAG-- utm_source in Querystring: ", utm_source);

  if (utm_source) {
    setCookie("utm_source", utm_source, 30);
    //console.log("--TAG-- utm_source cookie set: ", utm_source);
  } else {
    utm_source = getCookie("utm_source");
    if (utm_source) {
      //console.log("--TAG-- utm_source levantado de cookie: " + utm_source);
    }
  }

  /* Setear UTM_SOURCE como DOC.REFERRER para tracking orgnico, si no existe UTM SOURCE */

  if ($(".utm_source") && utm_source) {
    $(".utm_source").val(utm_source);
  }

  if ($("#Code") && promo_code && promo_code !== "developer") {
    if (!$("#Code").val()) {
      console.log('Promo Code SET: ', promo_code);
      $("#Code").val(promo_code);
    }
  }

  /* Si no hay tag y hay utm_source, que lo habr, asignarle utm_source al tag para luego utilizarlo */

  if (tag == "NN" && utm_source) {
    tag = utm_source;
    //console.log("--TAG-- Tag asignado desde utm_source");
  }

  if (tag == "NN" || !tag || tag == "") {
    var referrerHostname = extractHostname(document.referrer);
    tag = referrerHostname;
    //console.log("--TAG-- Tag asignado desde doc.ref");
  }

  if (tag != "NN") {
    tag = extractHostname(tag);
    setCookie("tag", tag, 30);
    if (tagPxsolEngine) {
      tagPxsolEngine = tag;
    }
    //console.log("--TAG-- Cookie tag asignada: ", tag);
    if ($(".tag_cookie")) {
      $(".tag_cookie").val(tag);
      $(".tag_cookie").text(tag);
      $("#Tag").val(tag);
    }
  }

  //console.log('--TAG-- Tag / Medio: ' + tag);
  return tag;
}

