if (typeof finalCallbacks !== "undefined") {
  if (typeof finalCallbacks === 'object' && finalCallbacks.length) {
    finalCallbacks.forEach(element => {
      try {
        if (typeof element === 'function') element();
      } catch (error) {
        console.log('Error Final Callback',error);
      }
    });
    finalCallbacks = [];
  }
}

var swiperInstancesArray = [];

function reinitialization() {
  console.log("--DBUG-- Reinitializing Swipers / LazyLoad");
  $("[lazy-src], [data-lazy]").each(function() {
    $(this).attr("src", $(this).attr("lazy-src"));
    if (!$(this).attr("lazy-src"))
      $(this).attr("src", $(this).attr("data-lazy"));
  });

  if (typeof habSwiperInstances !== "undefined")
    swiperInstancesArray.push(habSwiperInstances);
  if (typeof swiperInstances !== "undefined")
    swiperInstancesArray.push(swiperInstances);
  if (typeof stdSwiperInstances !== "undefined")
    swiperInstancesArray.push(stdSwiperInstances);

  //console.log("--DBUG-- SwiperInstancesArray:", swiperInstancesArray);

  $(swiperInstancesArray).each(function(index, swInstance) {
    //console.log("--DBUG-- SwiperInstance:", swInstance);
    if (swInstance && swInstance.length > 0) {
      $(swInstance).each(function(index, instance) {
        try {
          instance.update();
          //console.log("--DBUG-- SwiperInstance Update Success:", instance);
        } catch (e) {
          //console.log("--DBUG-- SwiperInstance Update Error:", e, instance);
        }
      });
    }
  });
}

reinitialization();

document.onreadystatechange = function() {
  //console.log("DocumentReadyState:", document.readyState);
  if (document.readyState == "complete") {
    reinitialization();
  }
};

